import React, { useState } from 'react';
import { Folder, MoreVertical, Share2, Edit3, Trash2, Calendar } from 'lucide-react';

const FolderCard = ({ folder, onOpen, onShare, onDelete, onEdit, showActions = true }) => {
  const [showMenu, setShowMenu] = useState(false);

  const handleClick = (e) => {
    if (!e.target.closest('.action-menu') && !e.target.closest('.folder-actions')) {
      onOpen(folder);
    }
  };

  const handleAction = (action, e) => {
    e.stopPropagation();
    setShowMenu(false);
    
    switch (action) {
      case 'share':
        onShare(folder);
        break;
      case 'edit':
        onEdit && onEdit(folder);
        break;
      case 'delete':
        onDelete(folder.id);
        break;
    }
  };

  return (
    <div 
      className="group bg-white rounded-xl border border-gray-200 hover:border-blue-300 hover:shadow-md transition-all duration-200 cursor-pointer relative"
      onClick={handleClick}
    >
      {/* Main Content */}
      <div className="p-6">
        <div className="flex items-start justify-between">
          <div className="flex items-center space-x-4 flex-1">
            {/* Folder Icon */}
            <div className="flex-shrink-0">
              <div className="w-12 h-12 bg-gradient-to-br from-blue-500 to-blue-600 rounded-lg flex items-center justify-center shadow-sm">
                <Folder className="h-6 w-6 text-white" />
              </div>
            </div>
            
            {/* Folder Info */}
            <div className="flex-1 min-w-0">
              <h3 className="text-lg font-semibold text-gray-900 truncate group-hover:text-blue-700 transition-colors">
                {folder.name}
              </h3>
              <div className="flex items-center space-x-4 mt-2 text-sm text-gray-500">
                <div className="flex items-center space-x-1">
                  <Calendar className="h-4 w-4" />
                  <span>
                    {folder.createdAt 
                      ? new Date(folder.createdAt).toLocaleDateString('en-US', {
                          month: 'short',
                          day: 'numeric',
                          year: 'numeric'
                        })
                      : 'Unknown'
                    }
                  </span>
                </div>
                {folder.itemCount && (
                  <span className="text-gray-400">
                    {folder.itemCount} items
                  </span>
                )}
              </div>
            </div>
          </div>

          {/* Actions Menu */}
          {showActions && (
            <div className="folder-actions relative">
              <button
                onClick={(e) => {
                  e.stopPropagation();
                  setShowMenu(!showMenu);
                }}
                className="p-2 rounded-lg opacity-0 group-hover:opacity-100 hover:bg-gray-100 transition-all duration-200"
              >
                <MoreVertical className="h-5 w-5 text-gray-500" />
              </button>

              {/* Dropdown Menu */}
              {showMenu && (
                <div className="action-menu absolute right-0 top-full mt-2 w-48 bg-white rounded-lg shadow-lg border border-gray-200 py-1 z-10">
                  <button
                    onClick={(e) => handleAction('share', e)}
                    className="w-full flex items-center px-4 py-2 text-sm text-gray-700 hover:bg-gray-50 transition-colors"
                  >
                    <Share2 className="h-4 w-4 mr-3 text-gray-500" />
                    Share
                  </button>
                  
                  {onEdit && (
                    <button
                      onClick={(e) => handleAction('edit', e)}
                      className="w-full flex items-center px-4 py-2 text-sm text-gray-700 hover:bg-gray-50 transition-colors"
                    >
                      <Edit3 className="h-4 w-4 mr-3 text-gray-500" />
                      Rename
                    </button>
                  )}
                  
                  <hr className="my-1" />
                  
                  <button
                    onClick={(e) => handleAction('delete', e)}
                    className="w-full flex items-center px-4 py-2 text-sm text-red-600 hover:bg-red-50 transition-colors"
                  >
                    <Trash2 className="h-4 w-4 mr-3" />
                    Delete
                  </button>
                </div>
              )}
            </div>
          )}
        </div>
      </div>

      {/* Hover Effect Overlay */}
      <div className="absolute inset-0 bg-gradient-to-r from-blue-500/5 to-indigo-500/5 opacity-0 group-hover:opacity-100 transition-opacity duration-200 rounded-xl pointer-events-none"></div>
      
      {/* Click outside to close menu */}
      {showMenu && (
        <div 
          className="fixed inset-0 z-5"
          onClick={() => setShowMenu(false)}
        />
      )}
    </div>
  );
};

export default FolderCard;
